import React, { Component } from "react";
import "./styles.scss";
import { Link } from "react-router-dom";

class Cart extends Component {
  render() {
    return (
      <>
        <div className="row h-100 align-items-center">
          <div className="col-2 ">
            <div className="compare-title text-white">
              <h2>Compare</h2>
              <div className="amount-product font-family-Ti size-18">
                2 product(s)
              </div>
            </div>
          </div>
          <div className="col-6"></div>
          <div className="col-3">
            <Link
              to="/global/register"
              className="btn caption-btn signup rounded-0 shadow-none"
            >
              SIGN UP
            </Link>
          </div>
          <button className="btn caption-btn login rounded-0 shadow-none">
            LOG IN
          </button>
        </div>
      </>
    );
  }
}

export default Cart;
